CREATE TABLE `message` (
  `message_id` int(11) NOT NULL AUTO_INCREMENT,
  `tutor_id` int(11) DEFAULT NULL,
  `student_id` int(11) DEFAULT NULL,
  `message_text` text DEFAULT NULL,
  `timestamp` timestamp NOT NULL DEFAULT current_timestamp(),
  PRIMARY KEY (`message_id`),
  KEY `tutor_id` (`tutor_id`,`student_id`),
  KEY `student_id` (`student_id`),
  CONSTRAINT `message_ibfk_1` FOREIGN KEY (`student_id`) REFERENCES `student` (`user_id`) ON DELETE CASCADE ON UPDATE NO ACTION,
  CONSTRAINT `message_ibfk_2` FOREIGN KEY (`tutor_id`) REFERENCES `tutor` (`user_id`) ON DELETE CASCADE ON UPDATE NO ACTION
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;

CREATE TABLE `module_submit` (
  `submit_id` int(11) NOT NULL AUTO_INCREMENT,
  `description` text NOT NULL,
  `grade` int(255) NOT NULL DEFAULT 0,
  `tutor_comment` text DEFAULT NULL,
  `file_name` varchar(255) NOT NULL,
  `file_type` varchar(255) NOT NULL,
  `file_path` varchar(255) NOT NULL,
  `module_id` int(11) NOT NULL,
  `user_id` int(11) NOT NULL,
  `date_posted` timestamp NOT NULL DEFAULT current_timestamp() ON UPDATE current_timestamp(),
  PRIMARY KEY (`submit_id`),
  KEY `module_id` (`module_id`,`user_id`),
  KEY `user_id` (`user_id`),
  CONSTRAINT `module_submit_ibfk_1` FOREIGN KEY (`user_id`) REFERENCES `student` (`user_id`) ON DELETE CASCADE ON UPDATE NO ACTION,
  CONSTRAINT `module_submit_ibfk_2` FOREIGN KEY (`module_id`) REFERENCES `tutorial_module` (`module_id`) ON DELETE CASCADE ON UPDATE NO ACTION
) ENGINE=InnoDB AUTO_INCREMENT=4 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;
INSERT INTO `module_submit` (`submit_id`,`description`,`grade`,`tutor_comment`,`file_name`,`file_type`,`file_path`,`module_id`,`user_id`,`date_posted`) VALUES ('1','Done answer.','20','','DFD Tutor 1.png','image/png','../uploads/DFD Tutor 1.png','1','1','2024-02-16 15:46:22');

CREATE TABLE `student` (
  `user_id` int(11) NOT NULL AUTO_INCREMENT,
  `email` varchar(255) NOT NULL,
  `password` varchar(255) NOT NULL,
  `firstname` varchar(255) NOT NULL,
  `middlename` varchar(255) NOT NULL,
  `lastname` varchar(255) NOT NULL,
  `suffix` varchar(255) NOT NULL,
  `phone_number` varchar(255) NOT NULL,
  `gender` varchar(255) NOT NULL,
  `barangay` varchar(255) NOT NULL,
  `municipality` varchar(255) NOT NULL,
  `zipcode` varchar(255) NOT NULL,
  `gradelevel` varchar(255) NOT NULL,
  `school` varchar(255) NOT NULL,
  `id_picture` longblob NOT NULL,
  `profilepicture` longblob NOT NULL,
  `user_status` varchar(255) NOT NULL DEFAULT 'Pending',
  `otp` varchar(255) DEFAULT NULL,
  `timestamp` timestamp NOT NULL DEFAULT current_timestamp() ON UPDATE current_timestamp(),
  PRIMARY KEY (`user_id`)
