CREATE TABLE `student_notification` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `user_id` int(50) NOT NULL,
  `message` text NOT NULL,
  `created_at` timestamp NOT NULL DEFAULT current_timestamp() ON UPDATE current_timestamp(),
  `read_status` int(11) NOT NULL DEFAULT 0,
  PRIMARY KEY (`id`),
  KEY `user_id` (`user_id`),
  CONSTRAINT `student_notification_ibfk_1` FOREIGN KEY (`user_id`) REFERENCES `student` (`user_id`) ON DELETE CASCADE ON UPDATE NO ACTION
) ENGINE=InnoDB AUTO_INCREMENT=7 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;
INSERT INTO `student_notification` (`id`,`user_id`,`message`,`created_at`,`read_status`) VALUES ('1','1','Your application to Science has been accepted','2024-02-16 15:41:59','1');
INSERT INTO `student_notification` (`id`,`user_id`,`message`,`created_at`,`read_status`) VALUES ('2','1','Your <b>Science</b> module has been unlocked. You can now download the module files!','2024-02-16 15:41:59','1');

CREATE TABLE `student_payment` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `application_id` int(50) NOT NULL,
  `module_id` int(50) NOT NULL,
  `amount` varchar(255) NOT NULL,
  `reference` varchar(255) NOT NULL,
  `receipt` longblob NOT NULL,
  PRIMARY KEY (`id`),
  KEY `application_id` (`application_id`,`module_id`),
  KEY `job_id` (`module_id`),
  CONSTRAINT `student_payment_ibfk_2` FOREIGN KEY (`module_id`) REFERENCES `tutorial_module` (`module_id`) ON DELETE CASCADE ON UPDATE NO ACTION
) ENGINE=InnoDB AUTO_INCREMENT=8 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;

CREATE TABLE `subscriptions` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `user_id` int(11) NOT NULL,
  `subscription_type` enum('Monthly','Yearly') NOT NULL,
  `status` varchar(255) NOT NULL DEFAULT 'Pending',
  `approved_date` timestamp NOT NULL DEFAULT current_timestamp() ON UPDATE current_timestamp(),
  `expiration_date` timestamp GENERATED ALWAYS AS (case when `subscription_type` = 'monthly' then `approved_date` + interval 1 month when `subscription_type` = 'yearly' then `approved_date` + interval 1 year else NULL end) STORED,
  `reference` varchar(255) NOT NULL,
  `modeofpayment` varchar(255) NOT NULL,
  `receipt` longblob DEFAULT NULL,
  `stamp` timestamp NOT NULL DEFAULT current_timestamp(),
  PRIMARY KEY (`id`),
  KEY `user_id` (`user_id`),
